import React from 'react';
import VideoFilesService from '../Service/VideoFilesService';
import axios from 'axios';
import ReactPlayer from 'react-player';
<link rel="stylesheet" href="/css/video-react.css" />

class VideoFileComponent extends React.Component{
  constructor(props:any){
    super(props)
    this.state={
      links:[],
      title:'',
      link:'',
      creationDate:''
    }
  }
  componentDidMount(){
    VideoFilesService.getvideoFiles(1).then((res)=>this.setState({links:res.data}));
  }
  submit(event:any,title:string){
    event.preventDefault();
    axios.post('http://localhost:8080/videoFiles/save',{
      title:this.state.title,
      link:this.state.link,
      creationDate:this.state.creationDate
    })
    .then((res)=>{
      this.componentDidMount();
    })
    

  }
  delete(title:string){
    VideoFilesService.deleteVideoFiles(title)
    .then(()=>{
      this.componentDidMount();
    })
  }
  edit(title:string){
    VideoFilesService.getVideoFilesbyid(title)
    .then((res)=>{
      console.log(res.data);
      this.setState({
        title:res.data.title,
        link:res.data.link,
        creationDate:res.data.creationDate
      })
    })}
  render(){
    return (
      
       <div className="container" >
    
       <div className="row">
       <div className="col s6">
           <form onSubmit={(e)=>this.submit(e,this.state.title)}>
           <div class="input-field col s12">
             <i class="material-icons prefix">person</i>
             <input onChange={(e)=>this.setState({title:e.target.value})} value={this.state.title} type="text" id="autocomplete-input" class="autocomplete" />
             <label for="autocomplete-input">Autocomplete</label>
           </div>
           <div class="input-field col s12">
             <i class="material-icons prefix">link</i>
             <input onChange={(e)=>this.setState({link:e.target.value})} value={this.state.link} type="text" id="autocomplete-input" class="autocomplete" />
             <label for="autocomplete-input">Autocomplete</label>
           </div>
           <div class="input-field col s12">
             <i class="material-icons prefix">vpn_key</i>
             <input onChange={(e)=>this.setState({creationDate:e.target.value})} value={this.state.creationDate} type="text" id="autocomplete-input" class="autocomplete" />
             <label for="autocomplete-input">Autocomplete</label>
           </div>
           <button class="btn waves-effect waves-light right" type="submit" name="action">Submit
             <i class="material-icons right">send</i>
           </button>
           </form>
         </div>
         <div className="col s6">
         <table>
           <thead>
             <tr>
                 <th>Name</th>
                 <th>Email</th>
                 <th>Password</th>
                 <th>Edit</th>
                 <th>Delete</th>
             </tr>
           </thead>
   
           <tbody>
             {
               this.state.users.map(user=>
                 <tr key={user.id}>
                   <td>{user.name}</td>
                   <td>{user.email}</td>
                   <td>{user.password}</td>
                   <td>
                   <button onClick={(e)=>this.edit(user.id)} class="btn waves-effect waves-light" type="submit" name="action">
                     <i class="material-icons">edit</i>
                   </button>
                   </td>
                   <td>
                   <button onClick={(e)=>this.delete(user.id)} class="btn waves-effect waves-light" type="submit" name="action">
                     <i class="material-icons">delete</i>
                   </button>
                   </td>
                 </tr>
                 )
             }
             
           </tbody>
         </table>
         </div>
       
       </div>
       </div>
  );}
  
}

export default VideoFileComponent;
